$(document).ready(function(){$(".modal").modal();$(".dropdown-trigger").dropdown({coverTrigger:false});$("select").formSelect();$(".sidenav").sidenav({closeOnClick:true,draggable:true,preventScrolling:true});$(".tabs").tabs();$(".tooltipped").tooltip();$('li[id^="select-options"]').on("touchend",function(e){e.stopPropagation()});$(".collapsible").collapsible({accordion:false});$(window).resize(function(){let trs=[...document.getElementById("table-to-adapt-columns").rows];if($(window).width()<=983){trs.forEach(element=>element.style.height=Math.max(...trs.map(x=>x.offsetHeight))+"px")}else trs.forEach(element=>element.style.height="auto")});$(document).ready(function(){if($(window).width()<=992){let trs=[...document.getElementById("table-to-adapt-columns").rows];trs.forEach(element=>element.style.height=Math.max(...trs.map(x=>x.offsetHeight))+"px")}})});